"""
# 6.Construindo o modelo preditivo

- Agora que jÃ¡ analisamos os dados, surge mais uma demanda: Criar uma forma de prever a quantidade de bicicletas alugadas no futuro para ajudar a empresa, para fazer isso vamos usar o Prophet.
- Prophet Ã© uma ferramenta de cÃ³digo aberto desenvolvida pelo Facebook para a previsÃ£o de sÃ©ries temporais. Ã‰ projetada para lidar com dados com sazonalidade diÃ¡ria, semanal e anual, alÃ©m de efeitos de feriados. Ã‰ robusta a dados ausentes e mudanÃ§as nas tendÃªncias, sendo fÃ¡cil de usar e interpretÃ¡vel.
Link:"""

# Importando a biblioteca
from prophet import Prophet #Modelo de regressÃ£o aditivo

"""A biblioteca Prophet usa um modelo aditivo que inclui componentes sazonais e de tendÃªncia. A equaÃ§Ã£o utilizada pelo Prophet para realizar previsÃµes pode ser representada da seguinte forma:

$y(t) = g(t) + s(t) + h(t) + \epsilon_t$

Onde:

- $ y(t)$ Ã© o valor observado na sÃ©rie temporal no tempo \( t \).
- $ g(t) $ Ã© a componente de tendÃªncia que modela mudanÃ§as de longo prazo.
- $ s(t) $ Ã© a componente sazonal que modela padrÃµes periÃ³dicos ou sazonais.
- $ h(t) $ Ã© a componente de efeito de feriados
- $\epsilon_t$ Ã© o erro aleatÃ³rio na previsÃ£o.

Cada uma dessas componentes Ã© modelada separadamente. A componente de tendÃªncia, $ g(t)$, Ã© frequentemente modelada como uma funÃ§Ã£o logÃ­stica ou polinomial. A componente sazonal, $s(t)$, Ã© modelada usando a anÃ¡lise de Fourier para capturar padrÃµes periÃ³dicos. A componente de feriado, $h(t)$, Ã© modelada como um efeito aditivo para cada feriado especificado.

Portanto, a equaÃ§Ã£o completa usada pelo Prophet para realizar previsÃµes Ã© uma soma desses componentes mais o erro aleatÃ³rio.

> Embora em nosso projeto nÃ£o tenhamos detalhado a inclusÃ£o dos feriados no modelo, Ã© importante ressaltar que essa possibilidade existe.

"""

# Criando DF com duas colunas, no modelo aceito pelo Prophet:

df_prophet = df_data[['data', 'contagem']].rename(columns = {'data':'ds', 'contagem':'y'})
df_prophet.head()

# Agrupando dias:

df_prophet = df_prophet.groupby('ds')['y'].sum().reset_index()
df_prophet.head()

# Definindo a seedy com numpy:

np.random.seed(4587)

# Criando o modelo e treinando ele

modelo = Prophet()
modelo.fit(df_prophet)
futuro = modelo.make_future_dataframe(periods = 90, freq = 'D')
previsao = modelo.predict(futuro)

"""Inicialmente vamos treinar com toda a nossa populaÃ§Ã£o, mas usualmente dividimos ela em treino e teste seguindo uma proporÃ§Ã£o de 70/30"""

# Visualizando os resultados:

fig1 = modelo.plot(previsao)

"""O grÃ¡fico mostra a previsÃ£o de aluguÃ©is de bicicletas ao longo do tempo, gerada pelo modelo Prophet. Os pontos pretos representam os dados histÃ³ricos de aluguÃ©is diÃ¡rios, enquanto a linha azul indica a previsÃ£o do modelo. A sombra azul ao redor da linha azul representa o intervalo de confianÃ§a da previsÃ£o. Observa-se um padrÃ£o sazonal claro, com picos nos meses de verÃ£o e vales nos meses de inverno, refletindo a influÃªncia das estaÃ§Ãµes do ano no uso das bicicletas. A linha de tendÃªncia mostra um aumento nos aluguÃ©is durante os meses quentes e uma diminuiÃ§Ã£o nos meses frios, com previsÃµes que seguem esse padrÃ£o. HÃ¡ algumas variaÃ§Ãµes nos dados histÃ³ricos que nÃ£o sÃ£o totalmente explicadas pelo modelo, indicando possÃ­veis anomalias ou eventos atÃ­picos.

"""

# olhando valores preditos (yhat - previsto, yhat_upper - limite superior, yhat_lower - limite inferior)

previsao[['ds', 'yhat', 'yhat_lower', 'yhat_lower']]

# GrÃ¡fico dos componentes da previsÃ£o

fig2 = modelo.plot_components(previsao)

"""O grÃ¡fico mostra trÃªs componentes da previsÃ£o do modelo Prophet: tendÃªncia, semanal e anual.

No primeiro grÃ¡fico, a tendÃªncia ao longo do tempo mostra um aumento gradual no nÃºmero de aluguÃ©is de bicicletas, especialmente a partir de 2016, indicando um crescimento contÃ­nuo.

No segundo grÃ¡fico, a sazonalidade semanal revela que os aluguÃ©is sÃ£o mais baixos aos domingos e aumentam ao longo da semana, atingindo o pico na quinta-feira, antes de cair novamente no sÃ¡bado.

No terceiro grÃ¡fico, a sazonalidade anual mostra um padrÃ£o com picos em julho e setembro, indicando que os aluguÃ©is sÃ£o mais altos durante o verÃ£o e mais baixos no inverno, com uma queda acentuada em janeiro.

## Separando a populaÃ§Ã£o em grupo e teste:

Separar os dados em conjuntos de treino e teste Ã© fundamental em modelos de sÃ©rie temporal para avaliar a capacidade de generalizaÃ§Ã£o do modelo. Imagine que vocÃª estÃ¡ treinando um modelo para prever o nÃºmero de vendas de uma empresa. Se vocÃª treinar o modelo com todos os dados disponÃ­veis e depois testÃ¡-lo com os mesmos dados, ele pode parecer Ã³timo, mas na prÃ¡tica pode falhar em prever o futuro.

Isso acontece porque o modelo pode simplesmente memorizar os padrÃµes especÃ­ficos dos dados de treinamento, sem realmente aprender a identificar padrÃµes gerais que se aplicam a novos dados. Ao separar os dados em treino e teste, vocÃª simula o cenÃ¡rio de previsÃ£o futura, garantindo que o modelo seja avaliado em sua capacidade de generalizaÃ§Ã£o, ou seja, em sua habilidade de fazer previsÃµes precisas em dados que nunca viu antes. Isso ajuda a garantir que o modelo seja robusto e confiÃ¡vel quando usado para fazer previsÃµes no mundo real.
"""

# Verrificando o tamanho para poder dividir:
df_prophet.shape

# Separando levando em conta uma proporÃ§Ã£o de 80/20:

df_treino = pd.DataFrame()

# Separando 80% dos dados para treino
df_treino['ds'] = df_prophet['ds'][:584] #
df_treino['y'] = df_prophet['y'][:584]

df_teste = pd.DataFrame()

# Separando 20% dos dados para teste
df_teste['ds'] = df_prophet['ds'][584:]
df_teste['y'] = df_prophet['y'][584:]

# Criando e treinando o modelo:

np.random.seed(4587)

modelo = Prophet()
modelo.fit(df_treino)
futuro = modelo.make_future_dataframe(periods=150, freq='D')
previsao = modelo.predict(futuro)

# Plotando a figura com dados reais e previstos para ver se o modelo estÃ¡ proximo

fig1 = modelo.plot(previsao)
plt.plot(df_teste['ds'], df_teste['y'], '.r')

"""Neste grÃ¡fico, observamos a previsÃ£o do modelo em azul com a faixa de confianÃ§a e os dados reais em preto e vermelho. Os pontos pretos representam os dados de treinamento, enquanto os pontos vermelhos representam os dados de teste. Percebe-se que o modelo se ajusta bem aos dados de treinamento (pretos), mas falha significativamente ao prever os dados de teste (vermelhos). Isso Ã© indicado pelo fato de que muitos pontos vermelhos estÃ£o fora da faixa de confianÃ§a prevista pelo modelo, especialmente nos perÃ­odos mais recentes do conjunto de dados. Esse comportamento provavelmente se deve ao fato do modelo nÃ£o ter conseguido captar a sazonalidade dos dados pela divisÃ£o do conjunto.

"""

# Vendo os componentes da previsÃ£o:

fig2 = modelo.plot_components(previsao)

"""Neste grÃ¡fico, observamos duas componentes da previsÃ£o do modelo: a tendÃªncia ao longo do tempo (grÃ¡fico superior) e a variaÃ§Ã£o semanal (grÃ¡fico inferior).

No grÃ¡fico superior, vemos que a tendÃªncia geral segue um padrÃ£o de aumento e diminuiÃ§Ã£o ao longo dos meses, com uma incerteza maior para o futuro prÃ³ximo. JÃ¡ no grÃ¡fico inferior, Ã© mostrado o comportamento semanal, onde os valores sÃ£o mais altos no meio da semana e caem drasticamente aos finais de semana.

Apesar de o modelo capturar a tendÃªncia geral, ele falha em captar corretamente a sazonalidade anual dos dados, como foi visto no primeiro treinamento, o que pode ser observado pela falta de correspondÃªncia entre a variaÃ§Ã£o semanal prevista e os padrÃµes reais observados. A falta de uma previsÃ£o precisa da sazonalidade sugere que o modelo precisa ser ajustado para incluir melhor esses efeitos cÃ­clicos, o que poderia melhorar a precisÃ£o das previsÃµes e sua aplicabilidade em contextos reais.
"""

# Obtendo mÃ©tricas

df_previsao = previsao[['ds', 'yhat']]
df_comparacao = pd.merge(df_previsao, df_teste, on='ds')
df_comparacao

"""A mÃ©trica MSE *(Mean Squared Error)* Ã© uma medida comum de avaliaÃ§Ã£o de desempenho para modelos de regressÃ£o e previsÃ£o. Ela calcula a mÃ©dia dos quadrados das diferenÃ§as entre os valores previstos pelo modelo e os valores reais observados nos dados de teste. Matematicamente, o MSE Ã© calculado pela fÃ³rmula:

$MSE = \frac{\sum_{} (y_i - \hat{y}_i)^2}{n}$

No entanto, o MSE tem uma limitaÃ§Ã£o: suas unidades sÃ£o quadrÃ¡ticas em relaÃ§Ã£o Ã s unidades originais dos dados. Isso pode tornar difÃ­cil interpretar o seu valor
Para superar essa limitaÃ§Ã£o, muitas vezes Ã© preferÃ­vel usar o RMSE *(Root Mean Squared Error)*. O RMSE Ã© simplesmente a raiz quadrada do MSE e Ã© calculado pela fÃ³rmula:

$RMSE = \sqrt{MSE}$

"""

from sklearn.metrics import mean_squared_error

mse = mean_squared_error(df_comparacao['y'], df_comparacao['yhat'])
rmse = np.sqrt(mse)

print(f'MSE:{mse}, RMSE:{rmse}')

"""Vemos que estamos errando por 21 mil bicicletas, entÃ£o temos que melhorar muito mais o nosso modelo!

# 7. Melhrorando nosso modelo preditivo:
- Agora que construimos nosso modelo, e calculamos alguns dos seus parÃ¢metros, vamos estudar formas de melhorar sua previsÃ£o para o nosso caso.
- Primeiro vamos conferir os parametros do modelo para ver o que pode ser ajustado. Ao olhar a biblioteca vemos que existe um parametro para indicar sazonalidade anual chamado de yearly_seasonality(), vamos colocar ele como TRUE.
- Percebemos que nossos dados tem alguns outliers, como durante a greve do metrÃ´ de 2015, esses valores podem estar atrapalhando nosso modelo, entÃ£o vamos remover eles.
- Vamos expandir o perÃ­do de analise para 365 dias (1 ano) e observar como o modelo se comporta.
"""

# Ajustando o modelo:

np.random.seed(4587)

modelo = Prophet(yearly_seasonality=True) #adicionando sazonalidade
modelo.fit(df_treino)
futuro = modelo.make_future_dataframe(periods=150, freq='D')
previsao = modelo.predict(futuro)

# Plotando o grÃ¡fico:

fig1 = modelo.plot(previsao)
plt.plot(df_teste['ds'], df_teste['y'], '.r')

"""Neste grÃ¡fico, observamos novamente as previsÃµes do modelo (em azul) em comparaÃ§Ã£o com os dados reais (em preto e vermelho). Os pontos pretos representam os dados de treinamento, enquanto os pontos vermelhos representam os dados de teste. Comparando com o grÃ¡fico anterior onde o modelo nÃ£o previu corretamente, podemos observar alguns pontos importantes:

Primeiro, diferente do grÃ¡fico anterior onde a sazonalidade nÃ£o foi bem capturada, neste grÃ¡fico, o modelo parece ter captado melhor os padrÃµes sazonais dos dados de treinamento, o que Ã© visÃ­vel pela correspondÃªncia mais prÃ³xima entre os pontos pretos e a linha de previsÃ£o azul. Segundo, ainda assim, o modelo continua a errar significativamente na previsÃ£o dos dados de teste (pontos vermelhos). Muitos dos pontos vermelhos estÃ£o fora da faixa de confianÃ§a do modelo, especialmente nos perÃ­odos mais recentes. Isso indica que, apesar de uma melhor captura da sazonalidade nos dados de treinamento, o modelo ainda sofre de overfitting, o que compromete sua capacidade de generalizaÃ§Ã£o.
"""

# Vendo parÃ¢metros:

fig2 = modelo.plot_components(previsao)

"""Neste conjunto de grÃ¡ficos, observamos as componentes de tendÃªncia, variaÃ§Ã£o semanal e variaÃ§Ã£o anual do modelo.

O grÃ¡fico superior mostra a tendÃªncia geral ao longo do tempo. Percebemos uma ligeira diminuiÃ§Ã£o constante na tendÃªncia de dezembro de 2014 atÃ© dezembro de 2016, o que indica uma queda nos valores ao longo desse perÃ­odo.

O grÃ¡fico do meio exibe a variaÃ§Ã£o semanal, onde vemos que os valores tendem a ser mais baixos no domingo, aumentam ao longo da semana, atingindo o pico na quinta-feira, e depois diminuem novamente atÃ© sÃ¡bado. Este padrÃ£o cÃ­clico semanal reflete a sazonalidade nos dados, capturando as flutuaÃ§Ãµes esperadas ao longo dos dias da semana.

O grÃ¡fico inferior mostra a variaÃ§Ã£o anual, revelando a sazonalidade ao longo do ano. Notamos que os valores variam significativamente, com picos em torno de maio e setembro e quedas nos primeiros e Ãºltimos meses do ano. Essa variaÃ§Ã£o sazonal anual Ã© crucial para entender como os valores mudam ao longo do ano e deve ser levada em conta para melhorar as previsÃµes do modelo.

Esses grÃ¡ficos destacam a importÃ¢ncia de capturar a sazonalidade semanal e anual nos dados, algo que o modelo precisa considerar para melhorar a precisÃ£o das previsÃµes.
"""

# Criando mÃ©tricas de MSE e RMSE

df_previsao = previsao[['ds', 'yhat']]
df_comparacao = pd.merge(df_previsao, df_teste, on='ds')
df_comparacao

mse = mean_squared_error(df_comparacao['y'], df_comparacao['yhat'])
rmse = np.sqrt(mse)

print(f'MSE:{mse}, RMSE:{rmse}')

"""Agora vemos que jÃ¡ estamos errando bem menos, por cerca de 6200 bicicletas, mas o nosso modelo ainda estÃ¡ com uma previsÃ£o ruim!

## Tratando outilers:

- Vamos remover os outliers para ver se conseguimos melhorar nosso modelo.
"""

# Criando um data frame sem outliers
df_merged = df_prophet.merge(previsao[['ds', 'yhat_lower', 'yhat_upper']], on='ds')
sem_outliers = df_merged[(df_merged['y'] > df_merged['yhat_lower']) & (df_merged['y'] < df_merged['yhat_upper'])]
sem_outliers

df_treino = pd.DataFrame()

# Separando 80% dos dados para treino
df_treino['ds'] = sem_outliers['ds'][:505]
df_treino['y'] = sem_outliers['y'][:505]

df_teste = pd.DataFrame()

# Separando 20% dos dados para teste
df_teste['ds'] = sem_outliers['ds'][505:]
df_teste['y'] = sem_outliers['y'][505:]

# Treinando os dados tratados:

np.random.seed(4587)

modelo_sem_outliers = Prophet(yearly_seasonality=True)
modelo_sem_outliers.fit(df_treino)
futuro = modelo_sem_outliers.make_future_dataframe(periods=150, freq='D')
